import { useEffect, useState } from "react";
import { Outlet, useLocation, useNavigate,Link } from "react-router-dom";
import { ToastContainer, toast } from "react-toastify";
import { getAllCategories } from "./api";
import { NotificationContainer,NotificationManager } from 'react-notifications';
import 'react-toastify/dist/ReactToastify.css';

export default function Navigation(){

    const location = useLocation();
    const navigate = useNavigate();

    const [hasToken, setHasToken] = useState(false);
    const [categories,setCategories] = useState([]);

    useEffect(() => {
        const loadCat = async () => {
            const categories = await getAllCategories();
            setCategories(categories);
        }
        loadCat();
    });

    useEffect(() => {
        if(location.state){
            toast(location.state.message);
            location.state = null;
        }

        const user = JSON.parse(localStorage.getItem("user"));
        if(user)
            setHasToken(true);
    }, [location]);

    const logout = () => {
        localStorage.removeItem("user");
        navigate("/login");
        window.location.reload();
    };

    return(
        <div>
            { <ToastContainer /> }
            <div>
                <div className="container">
                    <div className="row-3">
                            <div className="col-12">
                                <nav className="navbar navbar-expand-lg navbar-light bg-warning px-3"><Link className="navbar-brand" to="http://localhost:3000/posts">Kino.kz</Link>
                                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
                                        <span className="navbar-toggler-icon"></span>
                                    </button>
                                    <div className="collapse navbar-collapse">
                                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                                    {
                                    categories.map((cat) => {
                                        return(
                                                <li className="nav-item mx-5 px-5" key={cat.id}>
                                                    <Link className="nav-link" to={'/posts/category/'+cat.id}>{cat.name}</Link>
                                                </li>
                                        )
                                    })
                                    }
                                            {
                                                hasToken ? (
                                                    <div className="d-flex">
                                                        <li className="nav-item mx-5">
                                                            <Link to="posts/my"  className="nav-link"><b>Мое_кино</b></Link>
                                                        </li>
                                                        <li className="nav-item active">
                                                            <button onClick={logout} className="nav-link"><b>Logout</b></button>
                                                        </li>
                                                    </div>
                                                ):(
                                                <div className="d-flex">
                                                    <li className="nav-item active mx-5">
                                                        <button onClick={() => {navigate("/login")}} className="nav-link"><b>Login</b></button>
                                                    </li>
                                                    <li className="nav-item active">
                                                        <button onClick={() => {navigate("/register")}} className="btn btn-primary"><b>Register</b></button>
                                                    </li>
                                                </div>
                                                )
                                            }
                                        </ul>
                                    </div>
                                </nav>
                            </div>
                    </div>
                </div><br/><br/>
            </div>
            <Outlet/>
        </div>
    )
}
